CREATE DEFINER=`root`@`localhost` PROCEDURE `acceptBook` (IN `insertID` INT)  BEGIN
	declare _isbn BIGINT;
    declare exist smallint;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION, NOT FOUND
    BEGIN
		ROLLBACK;
        GET DIAGNOSTICS CONDITION 1 @`errno` = MYSQL_ERRNO, @`sqlstate` = RETURNED_SQLSTATE, @`text` = MESSAGE_TEXT;
        SELECT 1 as code, CONCAT('ERROR ', @`errno`, ' (', @`sqlstate`, '): ', @`text`) as message;
	END;
    SELECT COUNT(*) INTO exist FROM new_books WHERE id = insertID;
    IF exist = 0 THEN
		SELECT 1 AS code, 'not found' as message;
	ELSE
        START TRANSACTION;
			SELECT isbn INTO _isbn FROM new_books WHERE id = insertID;
			INSERT INTO csdl20211_books.books(id, title, bdesc, pbDate, coverType, coverImage, copies, price)
					SELECT isbn, title, bdesc, pbDate, coverType, coverImage, copies, price FROM csdl20211_users.new_books nb
					WHERE nb.id=insertID;
			INSERT INTO csdl20211_books.book_category(bookID, catID)
				SELECT _isbn, catID FROM new_books_cat WHERE id = insertID;
			INSERT IGNORE INTO csdl20211_books.authors(aname)
				SELECT aname FROM new_publish WHERE id = insertID;
			INSERT INTO csdl20211_books.publish(bookID, authorID)
				SELECT _isbn, id FROM csdl20211_books.authors WHERE aname IN (SELECT aname FROM new_publish WHERE id = insertID);
			# DELETE FROM new_books WHERE id = insertID;
            UPDATE new_books SET stat='acc' WHERE id=insertID;
		COMMIT;
		SELECT 0 AS code, 'Successfully added a new book entry' as message;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `borrowBook` (IN `uID` INT, IN `bID` BIGINT, IN `uCredit` FLOAT, IN `period` SMALLINT)  bb: BEGIN
	DECLARE _price FLOAT;
    DECLARE _ncopies INT;
    DECLARE present INT;
    DECLARE borrowPrice FLOAT;
    DECLARE _stat CHAR(8);
    SELECT price, copies, count(*) INTO _price, _ncopies, present FROM csdl20211_books.books WHERE id=bID;
    IF present=0 THEN
		SELECT 1 as code, 'book not found' as message;
        LEAVE bb;
    END IF;
    IF _ncopies=0 THEN
		SELECT 1 as code, 'out of stock' as message;
        LEAVE bb;
    END IF;
    IF _price < 30.0 THEN
		SELECT greatest(3.0, _price/2) INTO borrowPrice;
    ELSE
		SET borrowPrice = _price/5;
    END IF;
    IF borrowPrice > uCredit THEN
		SELECT 1 as code, 'not enough credit' as message;
        LEAVE bb;
    END IF;
    START TRANSACTION;
		UPDATE csdl20211_books.books SET copies = copies - 1 WHERE id=bID;
		UPDATE users SET credit = credit-borrowPrice WHERE id=uID;
        SELECT COUNT(*), stat INTO present, _stat FROM borrow WHERE bookID=bID AND userID=uID;
        IF present = 0 THEN
			INSERT INTO borrow(bookID, userID, expireDate) VALUE (bID, uID, adddate(current_date(), period));
			SELECT 0 as code, 'Successfully borrow a copy of this book' as message;
		ELSE
			IF _stat='await' THEN
				SELECT 1 as code, 'Please return the last copy of this book' as message;
                ROLLBACK;
			ELSE
				IF _stat <> 'checked' THEN
					UPDATE borrow SET stat='await' WHERE bookID=bID AND userID=uID;
				ELSE
					SELECT 1 as code, 'Please wait while your last return is being examined' as message;
                    ROLLBACK;
				END IF;
			END IF;
		END IF;
    COMMIT;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getNotifications` (IN `uID` INT)  BEGIN
	# check return deadline
	SELECT bookID, title, DATEDIFF(expireDate, CURRENT_DATE) as remain FROM (SELECT * FROM borrow WHERE userID=uID AND stat='await') br
    INNER JOIN (SELECT id, title FROM csdl20211_books.books) b ON br.bookID=b.id
    HAVING remain<=1 ORDER BY remain ASC LIMIT 5;
    # book returns report
    SELECT * FROM (SELECT * FROM borrow WHERE userID=uID AND stat='checked') borrow INNER JOIN (SELECT id, title FROM csdl20211_books.books) b ON borrow.bookID=b.id;
    # check new books requests stat
    SELECT isbn, title, stat FROM new_books WHERE userID=uID;
    # check new authors' info requests stat
    SELECT na.authorID, a.aname, na.stat FROM (SELECT * FROM new_authors_info WHERE userID=uID) na
    INNER JOIN (SELECT id, aname FROM csdl20211_books.authors) a ON na.authorID=a.id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getRequestedBooks` ()  BEGIN
	SELECT * FROM new_books WHERE stat IS NULL;
	SELECT * FROM new_books_cat WHERE id IN (SELECT id FROM new_books WHERE stat IS NULL);
    SELECT * FROM new_publish WHERE id IN (SELECT id FROM new_books WHERE stat IS NULL);
    SELECT id, name FROM users WHERE id IN (SELECT userID FROM new_books WHERE stat IS NULL);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getStatistic` (IN `lim` SMALLINT)  BEGIN
# get borrowed books statistic in recent months
SELECT YEAR(loanDate) y, MONTH(loanDate) m, COUNT(*) c FROM borrow GROUP BY y, m  ORDER BY y DESC, m DESC LIMIT lim;
# get most borrowed books
SELECT bookID, title, COUNT(*) c FROM borrow INNER JOIN (SELECT id, title FROM csdl20211_books.books) b ON b.id=borrow.bookID WHERE TIMESTAMPDIFF(MONTH, loanDate, CURRENT_DATE())<=1 GROUP BY bookID ORDER BY c DESC LIMIT lim;
# get users who borrow the most
SELECT userID, name, COUNT(*) c FROM borrow INNER JOIN (SELECT id, name FROM users) u ON borrow.userID=u.id WHERE TIMESTAMPDIFF(MONTH, loanDate, CURRENT_DATE())<=1 GROUP BY userID ORDER BY c DESC LIMIT lim;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insertComment` (IN `bID` BIGINT, IN `uID` INT, IN `comment` VARCHAR(500))  BEGIN
	declare cnt smallint;
    SELECT COUNT(*) INTO cnt FROM comments WHERE bookID = bID AND userID = uID;
    IF cnt > 5 THEN
		SELECT 1 as code, 'At most 5 comments for this book' as message;
	ELSE
		INSERT INTO comments(userID, bookID, comment) VALUES (uID, bID, comment);
        SELECT 0 as code, 'Thanks for your comment' as message;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `returnBook` (IN `uID` INT, IN `bID` BIGINT)  BEGIN
	DECLARE present INT DEFAULT 0;
    SELECT count(*) INTO present FROM borrow WHERE userID=uID AND bookID=bID;
	IF present=0 THEN
		SELECT 1 as code, 'You did not borrowed this book yet' as message;
	ELSE
		/* UPDATE csdl20211_books.books SET copies = copies + 1 WHERE id=bID;
		DELETE FROM borrow WHERE bookID=bID AND userID=uID;*/
        UPDATE borrow SET stat='ret', returnDate=current_date() WHERE bookID=bID AND userID=uID;
        SELECT 0 as code, 'Successfully return this copy' as message;
	END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `updateFine` (IN `bID` BIGINT, IN `uID` INT, `severity` CHAR(5))  BEGIN
	DECLARE fine FLOAT DEFAULT 0.0;
    DECLARE bookPrice FLOAT DEFAULT 0.0;
    DECLARE uCredit FLOAT;
	SELECT price into bookPrice FROM csdl20211_books.books WHERE id=bID;
    SELECT credit into uCredit FROM users WHERE id=uID;
	IF severity = 'slight' THEN
        SET fine = bookPrice/8.0;
    END IF;
	IF severity = 'medium' THEN
		SET fine = bookPrice/4.0;
	END IF;
	IF severity = 'severe' THEN
		SET fine = bookPrice*0.75;
	END IF;
    
    IF uCredit >= fine THEN
		UPDATE users SET credit=credit-fine WHERE id=uID;
	ELSE
		UPDATE users SET credit=0.0, stat='blocked' WHERE id=uID;
	END IF;
END$$

